import React, { useEffect } from "react";
import { useDispatch, useSelector } from "react-redux";

import "./Styles/styles.css";
import Card from "../../components/ui/CardsComponents/card/card.jsx";
import { fetchCards } from "../../redux/slices/cards";
import CardSkeleton from "../../components/ui/CardsComponents/cardSkeleton/CardSkeleton";

export const Men = () => {
  const dispatch = useDispatch();
  const { cards } = useSelector((state) => state.cards);

  const isCardsLoading = cards.status === "loading";

  console.log(cards);

  useEffect(() => {
    dispatch(fetchCards());
  }, [dispatch]);

  return (
    <div className="humans-container">
      <div className="head">
        <p>Men`s sneakers</p>
        <div className="form__group field">
          <input type="input" className="form__field" placeholder="Search" />
          <label className="form__label">SEARCH</label>
        </div>
      </div>
      <div className="cards">
        {isCardsLoading ? (
          <CardSkeleton cards={4} />
        ) : (
          cards.items.map((sneaker, index) => {
            isCardsLoading ? (
              <Card key={index} />
            ) : (
              <Card
                brand={sneaker.brand}
                model={sneaker.model}
                cost={sneaker.cost}
                imageUrl={sneaker.imageUrl}
                color={sneaker.color}
              />
            );
          })
        )}
      </div>
    </div>
  );
};

export default Men;
